      map.search_index.insert('n' + n_id, { name: node.bigg_id,
        data: { type: 'metabolite',
          node_id: n_id } });
      map.search_index.insert('n_name' + n_id, { name: node.name,
        data: { type: 'metabolite',
          node_id: n_id } });
